I'm trying to create a rust app that can read the contents of the clipboard aloud using tts. I've found the elevenlabs.io api which seems to support tts, but I'm not sure how to use it in rust. I've also found the `clipboard` crate which can read the contents of the clipboard, but I'm not sure how to use it with the elevenlabs api.

Here's what I've tried so far:

1. I've created a new rust project using `cargo new --bin clipboard_tts`
2. I've added the `clipboard` and `reqwest` crates to my `Cargo.toml` file:

```
[dependencies]
clipboard = "0.5.0"
reqwest = { version = "0.11", features = ["json"] }
```

3. I've tried to use the `clipboard` crate to read the contents of the clipboard and the `reqwest` crate to make a request to the elevenlabs api, but I'm not sure how to put it all together.

Here's my current code:

```rust
use clipboard::ClipboardProvider;
use reqwest::Client;

fn main() -> Result<(), Box<dyn std::error::Error>> {
    let client = Client::new();
    let text = ClipboardProvider::new().get_contents()?;
    let response = client
        .post("https://api.elevenlabs.io/v1/text-to-speech/21m00Tcm4TlvDq8ikWAM")
        .header("xi-api-key", "YOUR_API_KEY")
        .json(&json!({
            "text": text,
            "voice_settings": {
                "stability": 0.5,
                "similarity_boost": 0.75
            }
        }))
        .send()?;

    let status = response.status();
    if status.is_success() {
        println!("Success: {}", status);
    } else {
        println!("Error: {}", status);
    }

    Ok(())
}
```

I'm not sure if this is the right approach, or if there's a better way to do this. Any help would be greatly appreciated!

Here's the elevenlabs api documentation for reference: <https://docs.elevenlabs.io/docs/text-to-speech>

